import React from 'react';
import Card from '../Card';

const CardList = ({item = []}) => {
    return (
        <div>
            <div>
                <h2>Найпопулярніший тур цього місяця</h2>
                
                {
                    item.map(({eng, rus}, index) => <Card key={index} eng={eng} rus={rus}/>)
                }
            </div>
        </div>
    );
}

export default CardList;
